import React from 'react'
import { createBrowserRouter, RouterProvider } from 'react-router-dom'
import Browser from './Browser'

const Body = () => {
  const appRouter = createBrowserRouter([
    {
      path:'/',
      element:<Body/>
    },
    {
      path:'/browser',
      element:<Browser/>
    },
  ])
  return (
    <div>
    <RouterProvider router={appRouter}/>
    </div>
  )
}

export default Body
